import React from "react";
import "./card.css";
class Card extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div class="card">
        <div class="icon">
          <i className="fa-solid fa-users"></i>
        </div>
        <div class="content">
          <div class="title">Trusted By Clients</div>
          <div class="description"></div>
        </div>
      </div>
    );
  }
}
export default Card;
